import React from 'react';

const Header = () => {
  return (
    <div className='header'>
      <button>自界</button>
      <button>筆記</button>
      <h1>barrystone</h1>
      <h2>Learning and making</h2>
      <button>github</button>
      <div className='header__img'>
        <div className='menu'> </div>
      </div>
    </div>
  );
};

export default Header;
